import React, {useState} from 'react';

const ImageUploadForm=()=>{
    const[selectedImage, setSelectedImage]=useState(null);
  }

const Registracija =()=>{
  const [korisnickoIme, setKorisnickoIme]=useState('');
  const [email, setEmail]=useState('');
  const [lozinka, setLozinka]=useState('');
  const [ime, setIme]=useState('');
  const [prezime, setPrezime]=useState('');
  const [datumRodjenja, setDatumRodjenja]=useState('');
  const [adresa, setAdresa]=useState('');
  const [tipKorisnika, setTipKorisnika]=useState('');
  const [slikaKorisnika, setSlikaKorisnika]=useState('');
  const [verifikova, setVerifikovan]=useState('');
  const [postarina, setPostarina]=useState('');
  
  const handleKorisnickoIme=(event)=>{
    setKorisnickoIme(event.target.value);
  }

  const handleEmail=(event)=>{
    setEmail(event.target.value);
  }

  const handleLozinka=(event)=>{
    setLozinka(event.target.value);
  }

  const handleIme=(event)=>{
    setIme(event.target.value);
  }

  const handlePrezime=(event)=>{
    setPrezime(event.target.value);
  }

  const handleDatumRodjenja=(event)=>{
    setDatumRodjenja(event.target.value);
  }

  const handleAdresa=(event)=>{
    setAdresa(event.target.value);
  }

  const handleTipKorisnika=(event)=>{
    setTipKorisnika(event.target.value);
  }

  

  const handleSlikaKorisnika=(event)=>{
    const imageFile=event.target.files[0];
    setSlikaKorisnika(imageFile);
  }

  const handleVerifikovan=(event)=>{
    setVerifikovan(event.target.value);
  }

  const handlePostarina=(event)=>{
    setPostarina(event.target.value);
  }

  const handleSubmit=(event)=>{
    event.preventDefault();
    //kako sliku convertovati pre slanja na server
    //logika za slanje podataka na server
    if(slikaKorisnika){
      console.log('Odabrana slika:', slikaKorisnika);
    }
    console.log("Uneli smo podatke za registraciju.")
  }

  return (
    <div>
      <h2>Registracija</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="korisnickoIme">Korisnicko ime:</label>
          <input type="text" id="korisnickoIme" value={korisnickoIme} onChange={handleKorisnickoIme}/>
        </div>
        <div>
          <label htmlFor="email">Email:</label>
          <input type="email" id="email" value={email} onChange={handleEmail}/>
        </div>
        <div>
          <label htmlFor="lozinka">Lozinka:</label>
          <input type="password" id="lozinka" value={lozinka} onChange={handleLozinka}/>
        </div>
        <div>
          <label htmlFor="ime">Ime:</label>
          <input type="text" id="ime" value={ime} onChange={handleIme}/>
        </div>
        <div>
          <label htmlFor="prezime">Prezime:</label>
          <input type="text" id="prezime" value={prezime} onChange={handlePrezime}/>
        </div>
        <div>
          <label htmlFor="datumRodjenja">Datum rodjenja:</label>
          <input type="date" id="datumRodjenja" value={datumRodjenja} onChange={handleDatumRodjenja}/>
        </div>
        <div>
          <label htmlFor="adresa">Adresa:</label>
          <input type="text" id="adresa" value={adresa} onChange={handleAdresa}/>
        </div>
        <div>
          <label htmlFor="tipKorisnika">Tip korisnika:</label>{/*ako izabere ovde prodavac da mu prikaze dodatno polje gde moze postarinu da unese */}
          <input type="text" id="tipKorisnika" value={tipKorisnika} onChange={handleTipKorisnika}/>
        </div>
        {/*Dal je verifikovan odredjuje admin */}
        {slikaKorisnika && (
        <div>
          <label htmlFor="slikaKorisnika">Izaberite sliku:</label>
          <input type="file" id="slikaKorisnika" accept="image/*" onChange={handleSlikaKorisnika}/>
          <h3>Odabrana slika:</h3>
          <img src={URL.createObjectURL(slikaKorisnika)} alt="Preview"/>
        </div>
        )}
        <div>
          <button type="submit">Registruj se</button>
        </div>
      </form>
    </div>
  );
};


export default Registracija;
